window.bookSummaryJSON = "<p>Axel's life was simple: He lived with his father in a small township, worked hard, and planned to be a respectable man just like his father. Then, he met Florence, and his small world suddenly spun out of his control. Accused of crimes and shunned by a family secret he never knew about, Axel is flung out of his small, sheltered life into a world of the unknown.&nbsp;</p> <p>Mythical creatures, wars, friendships made and lost - Axel has to grow and become a man in this new and scary place. He becomes strong, is trained as a warrior, and learns just how harsh the world can be. Follow Axel on his journey, laugh with him, cry with him, and fight with him.</p>"; 
